    <script>
    document.addEventListener("DOMContentLoaded", function() {
        window.MAP = map_865cd64cdfa2221f096a2f433e2bf0e1;

        var STREETS = [];

        function dist(a,b) {
            var dx=a[0]-b[0];
            var dy=a[1]-b[1];
            return dx*dx+dy*dy;
        }

        function focusNearest() {
            if(!navigator.geolocation) {
                alert("Геолокация не поддерживается");
                return;
            }
            if (STREETS.length === 0) {
                alert("Нет улиц на карте!");
                return;
            }
            navigator.geolocation.getCurrentPosition(function(pos){
                var u=[pos.coords.latitude,pos.coords.longitude];
                var best=0;
                var bestD=dist(u,STREETS[0].mid);

                for(var i=1;i<STREETS.length;i++){
                    var d=dist(u,STREETS[i].mid);
                    if(d<bestD){bestD=d;best=i;}
                }

                var s=STREETS[best];
                MAP.flyTo([s.mid[0],s.mid[1]],16);

                var distMeters = Math.sqrt(bestD) * 111320; // быстрый перевод в метры
                distMeters = Math.round(distMeters);

                L.popup()
                    .setLatLng([s.mid[0],s.mid[1]])
                    .setContent("Ближайшая улица: <b>"+ s.name + "</b><br>Расстояние: "+ distMeters + " м")
                    .openOn(MAP);
            },function(err){
                alert("Ошибка геопозиции: "+err.message);
            },{enableHighAccuracy:true});
        }

        var btn=document.createElement("button");
        btn.textContent="Показать ближайшую улицу ко мне";
        btn.style.position="absolute";
        btn.style.top="10px";
        btn.style.left="50%";
        btn.style.transform="translateX(-50%)";
        btn.style.padding="8px 12px";
        btn.style.background="white";
        btn.style.border="1px solid #888";
        btn.style.borderRadius="6px";
        btn.style.zIndex=99999;
        btn.onclick=focusNearest;
        document.body.appendChild(btn);
    });
    </script>
